import React from "react";
import { useEffect, useState } from "react";
import './sidebar.css'
import axios from "axios";
import { TbBrandGoogleHome } from "react-icons/tb";
import { TbLayoutDashboard } from "react-icons/tb";
import { CgUser } from "react-icons/cg";
import { MdOutlineBookmarkBorder } from "react-icons/md";
import { IoChatbubblesOutline } from "react-icons/io5";
import { useNavigate } from "react-router-dom";


function Sidebar() {
    const navigate = useNavigate();
    const [categories, setCategories] = useState([]);

    useEffect(() => {
        axios.get("/api/categories")
             .then(response => {
                setCategories(response.data);
        })
        .catch(error => {
            console.error("연결 오류", error);
        })
    }, []);

    return ( 
        <div className="sidebar">
            <div className="sidebarWrapper">
                <div className="sidebarBrend">
                    <h1>Wellty</h1>
                </div>
                <div className="sidebarMenu">
                    <ul>
                        {/* categories 배열에 따라 동적으로 항목 생성 */}
                        {categories.map((category, index) => (
                            <li key={index} className="sidebarItem" onClick={() => navigate(`/${category.toLowerCase()}`)}>
                                <span className="sidebarIcon">{/* Add an icon if necessary */}</span>
                                {category}
            </li>
        ))}
                        <li onClick={() => navigate("/")}>
                            <TbBrandGoogleHome className="sidebarIcon" />
                            Home
                        </li>
                        <li onClick={() => navigate("/dashboard")}>
                            <TbLayoutDashboard className="sidebarIcon" />
                            Dashboard
                        </li>
                        <li onClick={() => navigate("/users")}>
                            <CgUser className="sidebarIcon" />
                            Users
                        </li>
                        <li onClick={() => navigate("/reports")}>
                            <MdOutlineBookmarkBorder  className="sidebarIcon" />
                            Reports
                        </li>
                        <li onClick={() => navigate("/community")}>
                            <IoChatbubblesOutline className="sidebarIcon" />
                            Community
                        </li>
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default Sidebar;
